import re, json, requests

def fetch_gallery_info_http(gallery_id):
    # 1) HTML만 가져오기 (Selenium 불필요)
    url = f"https://k-hentai.org/r/{gallery_id}"
    html = requests.get(url, headers={"User-Agent":"Mozilla/5.0"}, timeout=5).text

    # 2) JS 객체 리터럴만 추출
    m = re.search(r'const gallery\s*=\s*({.*?});', html, re.DOTALL)
    if not m:
        raise RuntimeError("gallery 객체를 찾을 수 없습니다")
    obj = m.group(1)

    # 3) JSON으로 파싱
    try:
        return json.loads(obj)
    except json.JSONDecodeError:
        # 키에 따옴표, 작은따옴표 → 큰따옴표 치환
        fixed = re.sub(r'(\w+):', r'"\1":', obj).replace("'", '"')
        return json.loads(fixed)

